ECO-2の後継モデル【ECO-2+プラス】が入荷しました。厳しいEU環境基準適合した高品質なタイヤで、転がり抵抗とウェット路面でのグリップ性能を向上させるシリカコンパウンド及び特殊結合剤配合。 快適な乗り心地と、静粛性を兼ね揃えた、ナンカンの低燃費エコタイヤです。※タイヤのみの販売です。商品画像のホイールは付属致しません。ご注意ください。<style type="text/css">

