ご注文2本以上で送料無料！<br>
※1本の場合は\1,080の送料がかかります。（受注確認後、金額修正してメールにてお知らせ致します。）<br>
※北海道は1本につき別途\1,000、沖縄本島は1本につき別途\4,000が必要になります。（受注確認後、金額修正してメールにてお知らせ致します。）<br>
